import React from 'react';
import './Contact.css';

const Contact = () => {
  return (
    <section id="contact" className="contact">
      <h2>Contactez-moi</h2>
      <form>
        <input type="email" placeholder="Votre email" />
        <textarea placeholder="Votre message" />
        <button type="submit">Envoyer</button>
      </form>
    </section>
  );
}

export default Contact;
